A GSM_SpatialEntity is an abstract feature describing the sampling regime for the soil property predictions (OM_Observations) made by the GlobalSoilMap.net project. GSM_SpatialEntities are distributed on a regular 3-arc second grid and extend to a depth of 200 cm. Each has six related SF_SpatialSampling features describing intervals of 0-5 cm, 5-15 cm, 15-30 cm, 30-60 cm, 60-100 cm and 100-200 cm. They may be related to soil property estimates made at a 'point' (GSM_PrimarySpatialEntity) or within a volume (GSM_SecondarySpatialEntity).
A GSM_SpatialEnity shall have two related OM_Observations holding estimates of these properties:
- 'Depth to Rock';
- 'Plant Exploitable (Effective) Depth'
Each related SF_SpatialSamplingFeature shall have 10 related OM_Observations holding estimates of these properties:
- 'Organic Carbon';
- 'pHx10;
- 'Clay'
- 'Silt';
- 'Sand';
- 'Coarse Fragments';
- 'Effective Cation Exchange Capacity (ECEC)';
- 'Bulk Density (whole soil)';
- 'Bulk Density (fine earth)'; and
- 'Available Water Capacity'
